import { useEffect, useState } from "react"
import { useNavigate } from "react-router-dom"
import { MyRequest } from "./MyRequest"


import "./BookingForm.css"

export const BookingForm = () => {

    const localFatBackUser = localStorage.getItem("fatback_user")
    const fatbackUserObject = JSON.parse(localFatBackUser)

    const [genres, setGenres] = useState([])
    //const [client, setClients] = useState([])
    const [requests, setRequests] = useState([])

    const [request, setBookingForm] = useState({

        bandName: "",
        phoneNumber: "",
        genreId: 0,
        numOfSongs: "",
        startDate: "",
        endDate: "",
        musicianRequest: false,
        sessionMusicians: false,
        photoRequest: false,
        videoRequest: false,
        userId: fatbackUserObject.id

    })

    const navigate = useNavigate()

    useEffect(
        () => {
            fetch(`http://localhost:8088/genres`)
                .then(response => response.json())
                .then((genreArray) => {
                    setGenres(genreArray)
                })
        },
        []

    )

    // useEffect(
    //     () => {
    //         fetch(`http://localhost:8088/clients?&_embed=requests`)
    //             .then(response => response.json())
    //             .then((genreArray) => {
    //                 setClients(genreArray)
    //             })
    //     },
    //     []

    // )

    useEffect(
        () => {
            fetch(`http://localhost:8088/requests?_expand=genre&userId=${fatbackUserObject.id}`)
                .then(response => response.json())
                .then((requestInfo) => {
                    setRequests(requestInfo)
                })
        }, []
    )


    const submitButtonClick = (event) => {
        event.preventDefault()

        const newBookingRequest = {
            bandName: request.bandName,
            phoneNumber: request.phoneNumber,
            genreId: 0,
            numOfSongs: request.numOfSongs,
            startDate: request.startDate,
            endDate: request.endDate,
            musicianRequest: false,
            sessionMusicians: false,
            photoRequest: false,
            videoRequest: false,
            userId: fatbackUserObject.id
        }

        return fetch(`http://localhost:8088/requests`, {
            method: "POST",
            headers: {
                "Content-Type": "application/json",
            },
            body: JSON.stringify(newBookingRequest)
        })

            .then(response => response.json())
            .then(() => {
                navigate(`/myrequest`)
            })

    }

    return (
        <>{requests.length ? <div className="notice">"Your request is being reviewed."</div> :
            < div className="bookingForm" >
                <h2 className="bookingHeader">Booking Form</h2>
                <form>

                    <fieldset >
                        <div className="form-group">
                            <label className="label" htmlFor="bandName">Band Name: </label>
                            <input
                                required autoFocus
                                type="text"
                                className="form-control"
                                value={request.bandName}
                                onChange={
                                    (event) => {
                                        const copy = { ...request }
                                        copy.bandName = event.target.value
                                        setBookingForm(copy)
                                    }
                                }
                            />
                        </div>
                    </fieldset>

                    <fieldset>
                        <div className="form-group">
                            <label className="label" htmlFor="phoneNumber">
                                Phone Number:
                            </label>
                            <input
                                required autoFocus
                                type="text"
                                className="form-control"

                                value={request.phoneNumber}
                                onChange={
                                    (event) => {
                                        const copy = { ...request }
                                        copy.phoneNumber = event.target.value
                                        setBookingForm(copy)
                                    }
                                }
                            />

                        </div>
                    </fieldset>

                    <fieldset>
                        <div className="form-group">
                            <label className="label" htmlFor="genre">Choose a genre:</label>
                            <select id="genre" required
                                onChange={
                                    (event) => {
